import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ComputerList = () => {
  const [computers, setComputers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchComputers = async () => {
      try {
        const response = await axios.get('http://localhost:8090/api/v1/items/computers');
        setComputers(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching computers:', error);
        setError(error);
        setLoading(false);
      }
    };

    fetchComputers();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error fetching data: {error.message}</p>;

  return (
    <div>
      <h2>Computers</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Brand</th>
            <th>Years Used</th>
            <th>Description</th>
            <th>Image URL</th>
            <th>Signup Name</th>
            <th>Signup Email</th>
            <th>Signup Phone No</th>
            <th>Signup Location</th>
          </tr>
        </thead>
        <tbody>
          {computers.map((computer) => (
            <tr key={computer.id}>
              <td>{computer.id}</td>
              <td>{computer.brand}</td>
              <td>{computer.yearsUsed}</td>
              <td>{computer.description}</td>
              <td>{computer.imageUrl}</td>
              <td>{computer.signup?.name}</td>
              <td>{computer.signup?.email}</td>
              <td>{computer.signup?.phone_no}</td>
              <td>{computer.signup?.location}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ComputerList;
